import React from 'react'
import TodoItem from './TodoItem'

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0
    }
}

export default function TodoList(text = 'None') {
    return (
        <ul style={styles.ul}>
            <TodoItem text={text}/>
        </ul>)
}
